import React from 'react'

function Legend() {
  return (
    <div className="coin">
        <h3 className="rank">Rank</h3>
        <h3>Icon</h3>
        <h3>Name</h3>
        <h3>Symbol</h3>
        <h3>Price</h3>
    </div>
  )
}

export default Legend
